export default function Header() {
    return (
        <nav style={backgroundColor="#7e57c2"}>
            <div className="nav-wrapper header__nav">
                <a href="#" className="brand-logo">
                    React Practise
                </a>
                <ul id="nav-mobile" className="right hide-on-med-and-down">
                    <li>
                        <a href="#">Movie</a>
                    </li>
                </ul>
            </div>
        </nav>
    );
}
